-- ----------------------------
-- Table structure for loan_debt
-- ----------------------------
DROP TABLE IF EXISTS `loan_debt`;
CREATE TABLE `loan_debt`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT,
  `list_id` bigint(0) NOT NULL COMMENT '标的 id',
  `list_amount` decimal(18, 2) NOT NULL COMMENT '标的金额',
  `agreement_id` bigint(0) NULL DEFAULT NULL COMMENT '借款协议id',
  `borrower_id` bigint(0) NOT NULL COMMENT '借款人 id',
  `due_date` timestamp(0) NOT NULL COMMENT '应还时间',
  `period_no` int(0) NOT NULL COMMENT '分期期数',
  `period_seq` int(0) NOT NULL COMMENT '第几期',
  `principal` decimal(18, 2) NOT NULL COMMENT '本金',
  `interest` decimal(18, 2) NOT NULL COMMENT '利息',
  `service_fee` decimal(18, 2) NOT NULL COMMENT '服务费',
  `pre_service_fee` decimal(18, 2) NULL COMMENT '前置收取的服务费',
  `penalty_fee` decimal(18, 2) NOT NULL COMMENT '罚息',
  `overdue_notify_fee` decimal(18, 2) NOT NULL COMMENT '催收',
  `amount` decimal(18, 2) NOT NULL COMMENT '债务总额',
  `status` tinyint(0) NOT NULL COMMENT 'debt status, 0=正常未还, 1=已还全部, 2=部分还款，3=未还逾期',
  `repay_code_status` tinyint(0) NULL DEFAULT NULL COMMENT '0=未生成, 1=手动生成,2=自动生成,3=生成失败',
  `repay_code_time` timestamp(0) NULL DEFAULT NULL COMMENT '获取还款吗的时间',
  `owing_principal` decimal(18, 2) NOT NULL COMMENT '未付本金',
  `owing_interest` decimal(18, 2) NOT NULL COMMENT '未付利息',
  `owing_service_fee` decimal(18, 2) NOT NULL COMMENT '未付服务费',
  `owing_penalty_fee` decimal(18, 2) NOT NULL COMMENT '未付罚息',
  `owing_overdue_notify_fee` decimal(18, 2) NOT NULL COMMENT '未付罚息',
  `overdue_day` int(0) NULL DEFAULT NULL COMMENT '违约的天数',
  `owing_amount` decimal(18, 2) NOT NULL COMMENT '未付债务总额',
  `payment_time` timestamp(0) NULL DEFAULT NULL COMMENT '还款时间',
  `payment_amount` decimal(18, 2) NULL DEFAULT NULL COMMENT '已付总额',
  `overdue_fixed_charge` decimal(10, 2) NOT NULL COMMENT '滞纳金',
  `user_actual_payment_time` timestamp(0) NULL DEFAULT NULL COMMENT '用户实际还款的时间，来自资金',
  `version` int(0) NULL DEFAULT NULL COMMENT '版本',
  `inserttime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `updatetime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `isactive` tinyint(0) NULL DEFAULT NULL COMMENT '逻辑删除 null=删除 1=正常',
  `init_due_date` datetime(0) NULL DEFAULT NULL COMMENT '债务初始化的应还时间',
  `delay_count` int(0) NULL DEFAULT 0 COMMENT '已成功展期的次数',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7093 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '债务' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of loan_debt
-- ----------------------------

-- ----------------------------
-- Table structure for loan_debt_log
-- ----------------------------
DROP TABLE IF EXISTS `loan_debt_log`;
CREATE TABLE `loan_debt_log`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT,
  `debt_id` bigint(0) NOT NULL DEFAULT 0 COMMENT '债务id',
  `event_type` tinyint(0) NOT NULL COMMENT '1=手动获取还款码, 2=逾期算费定时任务, 3=SYS_RETRY, 4=MANUAL_RETRY, 5=REC_PAYING',
  `list_id` bigint(0) NOT NULL COMMENT '标的id',
  `borrower_id` bigint(0) NULL DEFAULT NULL COMMENT '借款人id，不再维护',
  `owing_principal` decimal(18, 2) NOT NULL COMMENT '未付本金',
  `owing_interest` decimal(18, 2) NOT NULL COMMENT '未付利息',
  `owing_service_fee` decimal(18, 2) NOT NULL COMMENT '未付服务费',
  `owing_penalty_fee` decimal(18, 2) NOT NULL COMMENT '未付罚息',
  `owing_overdue_notify_fee` decimal(18, 2) NOT NULL COMMENT '应还催收费',
  `owing_amount` decimal(18, 2) NOT NULL COMMENT '未付债务总额',
  `adding_amount` decimal(18, 2) NOT NULL COMMENT '新增费用',
  `due_date` timestamp(0) NOT NULL COMMENT '逾期时间',
  `overdue_day` int(0) NULL DEFAULT NULL COMMENT '逾期天数',
  `payment_amount` decimal(18, 2) NULL DEFAULT NULL COMMENT '还款金额',
  `payment_time` timestamp(0) NULL DEFAULT NULL COMMENT '还款时间',
  `repay_code_status` tinyint(0) NULL DEFAULT NULL COMMENT '生成还款码状态, 1=手动生成, 2=自动生成, 3=生成失败',
  `repay_code_time` timestamp(0) NULL DEFAULT NULL COMMENT '获取还款吗的时间',
  `version` int(0) NOT NULL COMMENT '版本',
  `operator_id` bigint(0) NULL DEFAULT NULL COMMENT '操作人id',
  `inserttime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '插入时间',
  `updatetime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `isactive` tinyint(0) NULL DEFAULT NULL COMMENT '逻辑删除 1正常 0删除',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_debt_list_id`(`debt_id`, `list_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2920 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

