-- ----------------------------
-- Table structure for loan_list
-- ----------------------------
DROP TABLE IF EXISTS `loan_list`;
CREATE TABLE `loan_list`  (
  `id` bigint(0) NOT NULL AUTO_INCREMENT,
  `borrower_id` bigint(0) NOT NULL COMMENT '借款人ID',
  `apply_amount` decimal(18, 2) NOT NULL COMMENT '用户申请的额度',
  `period_no` int(0) NOT NULL COMMENT '期数',
  `term_quantity` int(0) NOT NULL COMMENT '每期贷款时长',
  `term_unit` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `product_id` int(0) NOT NULL COMMENT '产品ID',
  `prod_type` tinyint(0) NOT NULL COMMENT '1=PDL, 2=INSTALLMENT',
  `interest` decimal(18, 2) NOT NULL COMMENT '利息',
  `interest_rate` decimal(10, 5) NOT NULL COMMENT '借款利率',
  `service_fee` decimal(18, 2) NOT NULL COMMENT 'drools给的应收服务费，实际收取逻辑是service_fee - service_fee_discount',
  `service_fee_discount` decimal(18, 2) NULL COMMENT '服务费优惠减免',
  `service_rate` decimal(10, 5) NOT NULL COMMENT '借款服务费率',
  `service_fee_type` int(0) NOT NULL COMMENT '服务费是否分期1是不分，2是分',
  `overdue_penalty_rate` decimal(10, 5) NOT NULL COMMENT '逾期罚息费率',
  `overdue_notify_rate` decimal(10, 5) NOT NULL COMMENT '逾期催收费率',
  `overdue_fixed_charge` decimal(10, 2) NOT NULL COMMENT '滞纳金',
  `withdraw_adjust_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '提现的时候为了满足尾数需求（假设5的倍数），调整的金额，大于零表示实际提现金额比应提现金额大，小于零表示实际提现金额小于应提现金额',
  `status` int(0) NOT NULL COMMENT '标的状态，兼容历史数据使用',
  `stage` int(0) NOT NULL COMMENT '标的处在的生命周期阶段, 10初始化，30审核，40投标，50转账，70提现，80还款，100结束，负数表示流标',
  `current_stage_status` tinyint(0) NOT NULL COMMENT '当前生命周期的状态， -1失败，0进行中，1成功',
  `list_title` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `list_desc` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `ass_type` int(0) NULL DEFAULT NULL COMMENT '攒标=1, 理财app可投； 不攒标=2,理财app不可投',
  `agreement_id` bigint(0) NULL DEFAULT NULL COMMENT '借款协议id',
  `loan_title` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `loan_purpose_code` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL,
  `audit_time` timestamp(0) NULL DEFAULT NULL COMMENT '审核系统给出审核结果时间',
  `full_bid_time` timestamp(0) NULL DEFAULT NULL COMMENT '成标时间',
  `effective_time` timestamp(0) NULL DEFAULT NULL COMMENT '用户收到款项时间',
  `inserttime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `updatetime` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `isactive` tinyint(0) NULL DEFAULT NULL COMMENT '逻辑删除 null=删除 1=正常',
  `risk_pass_time` timestamp(0) NULL DEFAULT NULL COMMENT '风控通过时间,兼容印尼使用，非印尼请使用audit_time',
  `amount` decimal(18, 2) NULL DEFAULT NULL COMMENT '借款金额，额度评估结果',
  `risk_level` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'pata给出标的风险等级',
  `result` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_borrower_id`(`borrower_id`) USING BTREE,
  INDEX `idx_status`(`status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1107 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'loan list table' ROW_FORMAT = Dynamic;

